

-- 20210119 增加重开奖异常订单记录表
-- ----------------------------
-- Table structure for bets_redraw_record
-- ----------------------------
DROP TABLE IF EXISTS `bets_redraw_record`;
CREATE TABLE `bets_redraw_record`  (
  `order_no` bigint(20) NOT NULL COMMENT '订单号',
  `tenant_code` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '租户code',
  `tenant_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '租户名称',
  `member_id` bigint(20) NOT NULL COMMENT '投注人用户ID',
  `member_type` tinyint(4) NULL DEFAULT NULL COMMENT '用户类型',
  `member_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '用户名',
  `lottery_id` bigint(20) NOT NULL COMMENT '彩种id',
  `issue` varchar(16) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '投注期号',
  `lottery_no` varchar(128) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT '' COMMENT '已开奖号码',
  `lottery_no_wish` varchar(128) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT '' COMMENT '应开奖号码',
  `win_amount` decimal(14, 3) NULL DEFAULT 0.000 COMMENT '已派奖金额',
  `win_amount_wish` decimal(14, 3) NULL DEFAULT 0.000 COMMENT '应派奖金额',
  `win_remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '已中奖注数明细',
  `win_remark_wish` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '应中奖注数明细',
  `status` int(11) NULL DEFAULT NULL COMMENT '状态: 1 扣款失败  2 已处理',
  `status_remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '说明：撤销已派奖扣款失败，余额不足  ；已完成线下处理',
  `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  PRIMARY KEY (`order_no`) USING BTREE,
  INDEX `idx_tc_mi_li_is_sta`(`tenant_code`, `member_id`, `lottery_id`, `issue`, `status`) USING BTREE,
  UNIQUE INDEX `idx_tc_on_ln`(`tenant_code`, `order_no`, `lottery_no`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '撤销派奖失败订单记录表' ROW_FORMAT = Dynamic;

-- add 20210201 撤销派奖失败订单记录增加订单金额
ALTER TABLE `bets_redraw_record`
ADD COLUMN `amount` decimal(14,3) DEFAULT '0.000' COMMENT '订单金额' AFTER `issue`;



