INSERT INTO `lottery_play_class_group` VALUES (1874, 123, 1753, '1710', '17101', '1710110', '任选一', '投注方案~01\n示例号码：\n包含01，即为中奖', '从01-80中任选1个以上号码，开奖号码中至少有一个号码与选择号码相同即中奖。', 1, 1, '2021-01-01 16:12:30', '2020-12-16 15:00:00');
