INSERT INTO `lottery_play_class_group` VALUES (1876, 123, 1755, '1710', '17103', '1710310', '任选三', '投注方案~01.02.03\n示例号码：\n包含01.02.03，即为中奖。', '从01-80个号码中任选3-8个号码，开奖号码中至少有两个号码与选择号码相同即中奖。', 1, 1, '2021-01-01 16:13:02', '2020-12-16 15:00:00');
INSERT INTO `lottery_play_class_group` VALUES (1877, 123, 1756, '1710', '17104', '1710410', '任选四', '投注方案~01，02，03，04\n示例号码：\n包含01.02.03.04，即为中奖。', '从01-80个号码中任选4-8个号码，开奖号码中至少有两个号码与选择号码相同即中奖。', 1, 1, '2021-01-01 16:14:24', '2020-12-16 15:00:00');
